package nikita123;

public class Array1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int weekdays[]= new int [10];
		weekdays[1]=9;
		weekdays[2]=5;
		weekdays[6]=12;
		weekdays[7]=19;
		
		for(int i=0;i<weekdays.length;i++) {
			
			System.out.print(weekdays[i]+" ");
		}
		System.out.println();
	}
	
}
